import { StatusBar } from "expo-status-bar";
import React from "react";
import { StyleSheet, Text, View, Image } from "react-native";
import { Ionicons } from "@expo/vector-icons";

export default function ProjectDetails({ navigation, route }) {
  return (
    <View style={{ flex: 1, paddingVertical: 50, backgroundColor: "#E6E9E8" }}>
      <View
        style={{
          flexDirection: "row",
          justifyContent: "space-between",
          marginHorizontal: 30,
        }}
      >
        <Ionicons
          name="arrow-back-sharp"
          onPress={() => navigation.goBack()}
          size={20}
          color="black"
        />
        <Ionicons name="menu-outline" size={20} color="black" />
      </View>

      <View style={{ width: "100%", alignItems: "center" }}>
        <Image
          source={require("../images/neko.jpg")}
          style={{ height: 400, width: 500 }}
        />
      </View>

      <View
        style={{
          width: "100%",
          flexDirection: "row",
          justifyContent: "space-around",
        }}
      >
        <View
          style={{
            height: 110,
            width: 110,
            backgroundColor: "#fff",
            borderRadius: 35,
            alignItems: "center",
            justifyContent: "center",
          }}
        >
          <Image
            style={{ height: 50, wight: 50 }}
            source={require("../images/blue.png")}
          />
        </View>
      </View>
    </View>
  );
}
